VALUES ('20711016', 'Pain Nordique Surprise', 'Pain surprise nordique congelé. 36 sandwiches. 12 sandwiches émietté de saumon fumé et zeste de citron semi confit, 12 sandwiches thon, tomates et câpres, 12 sandwiches poulet façon tikka. Ingrédients 60,6% pain polaire (farine de blé, eau, farine de seigle, sucre, huile de colza, sirop de sucre, gluten de blé, sel, levure, poudre de levain de seigle, émulsifiants mono-et diglycérides d\'acides gras et esters mono et diacéthyltartriques des mono - et diglycérides d\'acides gras, poudre à lever : carbonates d\'ammonium ; fructose; agent de traitement des farines acide ascorbique), 8,7% saumon fumé (poissons) (8,4% saumon Atlantique (poissons), sel), 8,3% fromage blanc (lait), 4,9% thon (poissons)(4,7% thon (poissons), eau, sel), 4,1% fromage frais (lait), lait demi écrémé stérilisé, 2,5% poulet mariné façon tikka (viande de cuisse de poulet 1,9%, eau, marinade (eau, semoule de riz, vinaigre d\'alcool blanc, coriandre, cumin, ail, persil, poivre, gingembre, girofle, tomate, sel, arômes naturels, amidon modifié de manioc, jus de citron concentré), fécule de manioc, sucre roux brun, dextrose de blé, amidon transformé de pomme de terre, sel], 1,5% préparation à base de tomates mi séchées (1% tomates séchées, concentré de tomates), huile de colza, sel, origan, sucre, ail), 1,4 % tomate mi séchée (1,3% tomates mi-séchées, huile de colza, ail, origan, sel), 1,1% purée de tomate, eau, 0,8% marinade tikka (huiles de colza-tournesol, épices et plantes aromatiques (dont curcuma, coriandre, oignon, ail, cardamone, gingembre, cannelle), sel, arômes naturels, émulsifiant: mono - et diglycérides d\'acide gras), 0,6% câpre (0,3% câpre, vinaigre d\'alcool, eau, sel), 0,6% jus de citron, amidon transformé de pomme de terre, huile d\'olive vierge extra, échalote, aneth, oignon, 0,1% zeste de citron semi confit (sirop de glucose-fructose, 0,02% zestes de citron jaune, eau, sucre, correcteur d\'acidité: acide citrique; antioxydant: acide ascorbique), roquette, sel, poivre. Traces éventuelles de céleri, de fruits à coque, de moutarde, de soja, de mollusques, de crustacés, de graines de sésame et d\'œufs. Viande de poulet origine Union européenne.', 'https://static.openfoodfacts.org/images/products/20711016/front_fr.16.400.jpg', '6.8', '1.6', '34.5', '5.7', '2.7', '10', '1.05', '0.413385826771654', '', '0');

